import apiUrl from "../apiConfig"
import axios from 'axios'

export const indexShips = () => {
    return axios.get(`${apiUrl}/starships`)
}

export const showStarShip = (id) => {
    return axios.get(`${apiUrl}/movies/${id}`)
}

export const getKanyeQuote = () => {
    return axios.get(`${apiUrl}`)
}
